import React, { useState, useEffect } from 'react';

const AdminPanel = () => {
  const [admin, setAdmin] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchAdmin();
  }, []);

  const fetchAdmin = async () => {
    try {
      const res = await fetch('http://localhost:5000/api/admin');
      const data = await res.json();
      setAdmin(data);
    } catch (error) {
      console.log('Admin fetch failed:', error);
      // Fallback to hardcoded data if API fails
      setAdmin({
        name: 'Nagateja Goli',
        email: 'nagatejareddygoli@gmail.com',
        phone: '+91 7994693055',
        photo: '/static_uploads/Nagateja Goli.jpg'
      });
    }
    setLoading(false);
  };

  if (loading) {
    return (
      <div className="loading-container">
        <div className="spinner"></div>
        <p>Loading admin dashboard...</p>
      </div>
    );
  }

  return (
    <div className="admin-panel">
      <div className="admin-hero">
        <div className="admin-card">
          <div className="admin-photo-section">
            <div className="admin-photo">
              {admin?.photo ? (
                <img 
                  src={admin.photo} 
                  alt="Nagateja Goli" 
                  className="admin-img"
                  onError={(e) => {
                    e.target.style.display = 'none';
                    e.target.nextSibling.style.display = 'flex';
                  }}
                />
              ) : null}
              <div className="admin-placeholder">
                <i className="fas fa-user-tie"></i>
              </div>
            </div>
          </div>
          
          <div className="admin-info">
            <div className="admin-header">
              <h1 className="admin-name">{admin?.name || 'Nagateja Goli'}</h1>
              <div className="admin-badge">Principal</div>
            </div>

            <div className="admin-contact">
              <div className="contact-item">
                <div className="contact-icon email">
                  <i className="fas fa-envelope"></i>
                </div>
                <div className="contact-details">
                  <span className="contact-label">Email</span>
                  <span className="contact-value">{admin?.email || 'nagatejareddygoli@gmail.com'}</span>
                </div>
              </div>
              <div className="contact-item">
                <div className="contact-icon phone">
                  <i className="fas fa-phone"></i>
                </div>
                <div className="contact-details">
                  <span className="contact-label">Phone</span>
                  <span className="contact-value">{admin?.phone || '+91 7994693055'}</span>
                </div>
              </div>
            </div>

            <div className="admin-stats">
              <div className="stat-item">
                <div className="stat-number">1,500+</div>
                <div className="stat-label">Total Students</div>
              </div>
              <div className="stat-item">
                <div className="stat-number">98.5%</div>
                <div className="stat-label">Avg Attendance</div>
              </div>
              <div className="stat-item">
                <div className="stat-number">5</div>
                <div className="stat-label">Branches</div>
              </div>
            </div>
          </div>
        </div>

        {/* Quick Actions */}
        <div className="admin-actions">
          <div className="action-card">
            <i className="fas fa-users"></i>
            <div>
              <h3>Manage Students</h3>
              <p>Add, edit, enroll faces</p>
            </div>
          </div>
          <div className="action-card">
            <i className="fas fa-chart-bar"></i>
            <div>
              <h3>View Reports</h3>
              <p>Attendance analytics</p>
            </div>
          </div>
          <div className="action-card">
            <i className="fas fa-cog"></i>
            <div>
              <h3>System Settings</h3>
              <p>Configure branches</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminPanel;
